import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import '../  /Navigation.css';

function Navigation() {
  const handleLogout = () => {
    // Implement your logout logic here
    alert("Logged out successfully!");
  };

  return (
    <div className="unique-nav-container">
      <Nav className="unique-nav" activeKey="/home">
        <Nav.Item>
          <Nav.Link href="/home">Shopify.IN</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-1">Add Product</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link eventKey="link-2">Order Details</Nav.Link>
        </Nav.Item>
        <div className="ml-auto">
          <Button variant="outline-danger" onClick={handleLogout}>Logout</Button>
        </div>
      </Nav>
    </div>
  );
}

export default Navigation;
